pragma solidity >=0.7.0 <0.9.0;

contract Document{

    address public manager;

    constructor(){
        manager=msg.sender;
    }

    struct Doc{

        string name;
        string to;
        string imageurl;
        string issuedBy;
        string issuedon;
        string desc;
        string validtill;
        
    }


   mapping(uint=>Doc) public docs;
   uint public count;

    function senddocument(string memory name,string memory to,string memory imageurl,string memory issuedBy,string memory issuedon,string memory desc,string memory validtill)  public {
        
        require(msg.sender==manager,"Only authorized authority can send");
        count++;
        docs[count]=Doc(name,to,imageurl,issuedBy,issuedon,desc,validtill);

        
    }

    function getdocuments(string memory walletaddress) public returns(Doc[] memory){
    

            Doc[] memory temp;
            for(uint i=1;i<=count;i++)
            {
                if(keccak256(bytes(docs[i].to))==keccak256(bytes(walletaddress)))
                {
                    temp[i-1]=docs[i];
                }
            }

            return temp;
    }








}
